import React, {Component} from 'react';
import './event-condensed.css';


class EventCondensed extends Component {
    
     constructor(props){
        super(props);
        this.createEventPeople= this.createEventPeople.bind(this);
                    
    }

    createEventPeople = () =>{
        const list = this.props.event.people.map((people) =>
            <p className="text-light">{people}</p>
        );
        return (list);
    }
    
    render(){
        return(
            <li>                        
                <h1 className="text-light event-title">{this.props.event.title}</h1>
                <div>{this.createEventPeople()}</div>
            </li>     
        )
    }
}

export default EventCondensed;
